import { Stack, Input, Button } from "@chakra-ui/react";
import React from "react";

interface IProps{

}
interface PostFormProps {
   plate?: string;
}

export class PostForm extends React.Component<IProps,PostFormProps> {

    constructor(props:IProps){
        super(props);
        this.state = {
            plate: '123456'
        };
    }

    render () {
        return (
            <div>
                <h1> Submit a request to Reserve space </h1> 
                <form>
                    <Stack spacing={3}>
                        <Input variant="outline" placeholder="Placa" width="500px" alignSelf="center"/>
                        <Input variant="outline" placeholder="Name" width="500px" alignSelf="center"/>
                        <Button type="submit" colorScheme="teal" variant="outline" width="100px" alignSelf="center">
                         Submit
                        </Button>
                    </Stack>
                </form>
            </div>
        )
    }
}

export default PostForm;
